import React from 'react';
import './nav.css';
import CartWidget from '../CartWidget/CartWidget';
const Nav=({pedido, onAdd}) => {
    return(
        <nav className='topnav'>   
        <a href="#">Inicio</a>
        <a href="#">Quienes somos</a>
        <a href="#">Contacto</a>
        <CartWidget className='logo' pedido={pedido} onAdd={onAdd}/> 
        </nav>
    )
}

export default Nav;
